<title>네이버 SMS 인증번호  발송 By 1stlove</title>
<meta name="viewport" content="width=device-width, initial-scale=1">
<script src="https://code.jquery.com/jquery-3.6.3.js"></script>
<form class="pure-form">
    <fieldset>
        <legend>네이버 SMS 인증번호 발송기</legend>
		<p>
		<span>전화번호 : </span>	
        <input type="text" placeholder="전화번호 입력해주세요" id="PhoneNumber" required>
		</p>
		<p>
		<span>API 키 : </span>	
        <input type="text" placeholder="API 키 입력해주세요" id="SMSapi" required>
		</p>
		<p>
		<span>보낼 수 : </span>	
		<input type="number" placeholder="반복수를 입력해주세요" id="SendTime" required min="1" max="300" ">
		</p>	
		<p>
		<span>딜레이 (초 단위) (15초 추천) : </span>	
		<input type="number" placeholder="딜레이를 입력해주세요" id="SendDelay" required min="1" max="1200" ">
		</p>	
		<p>
        <button type="button" class="ask_bottom_buttom" onclick="SendSMS()">
				<span>질문하기</span>	
			</button>
			</p>
			<span>네이버 인증번호 발송기는 1stlove.kro.kr 에서 전송되는 것이 아닌 현재 접속한 기기에서 발송 됩니다, 이점 참고 하시길 바랍니다.</span>
			<p></p>			
			<span>GET Request 상태를 받지 않아 실제 전송여부를 확인 할 수 없습니다.</span>
			<p></p>		
			<span>이 사이트는 개인 공부용(비영리 목적)으(로) 의해 제작 되었습니다.</span>
			<p></p>		
			<span>이 프로그램은 사용자에 의해 생기는 불이익은 1stlove.kro.kr 에서 책임 지지 않습니다.</span>	
    </fieldset>
</form>
